import { jsPDF } from "jspdf";
var font =
  "";
var callAddFont = function () {
  this.addFileToVFS("Times New Roman - Bold Italic-bolditalic.ttf", font);
  this.addFont(
    "Times New Roman - Bold Italic-bolditalic.ttf",
    "Times New Roman - Bold Italic",
    "bolditalic",
  );
};
jsPDF.API.events.push(["addFonts", callAddFont]);
